import React from "react";
import styled from "styled-components";
import { Link } from "react-router-dom";

export default function SuggestDymmy(props) {
  return (
    <>
      <Wrapper to={``}>
        <ProductBox>
          <ListImageBox>
            <img src={props.url} alt="제안사진" />
          </ListImageBox>

          <ProductInfo>
            <TitleInfo>
              <h4>{props.title}</h4>
              <h4>{props.content}</h4>
            </TitleInfo>

            <LocalDateTimeInfo>
              <span>2023년 01월 24일</span>
            </LocalDateTimeInfo>

            <PriceInfo>
              <span>by {props.memberName}</span>
              <span>likes {props.likeCount}</span>
            </PriceInfo>
          </ProductInfo>
        </ProductBox>
      </Wrapper>
    </>
  );
}

export const Wrapper = styled(Link)`
  /* margin-left: 6px; */
  margin-bottom: 30px;
  flex-shrink: 0;
  width: 264.75px;
  height: 100%;
  position: relative;
  transition-property: transform;
  text-decoration: none;
  color: inherit;
  margin-top: 0;
`;

export const ProductBox = styled.div`
  color: rgb(51, 51, 51);
  cursor: pointer;
  width: 340px;
  height: 100%;
  border-radius: 6px;
`;

export const ListImageBox = styled.div`
  overflow: hidden;
  position: relative;
  background-color: rgb(245, 245, 245);
  height: 180px;
  & img {
    width: 100%;
    height: 100%;
    object-fit: cover;
    transition: all 0.5s ease-in-out 0s;
  }
`;

export const TitleInfo = styled.div`
  position: relative;
  padding: 14px 10px 14px 10px;
  height: 120px;
  display: block;

  & h4 {
    font-size: 16px;
    line-height: 1.45;
    font-weight: 400;
    margin-bottom: 8px;
    overflow: hidden;
    text-overflow: ellipsis;
    display: -webkit-box;
    -webkit-line-clamp: 2;
    -webkit-box-orient: vertical;
    letter-spacing: normal;
    word-break: break-word;
    overflow-wrap: break-word;
  }
`;

export const LocalDateTimeInfo = styled.div`
  height: 20px;
  /* border: 1px solid #efefef; */
  padding: 14px 10px 14px 10px;
  font-color: #868e96;

  -webkit-box-pack: justify;
  -webkit-box-align: center;
  align-items: center;

  & span 
  {
     font-size: 16px;
    font-weight: 800;
    line-height: 1.5;
    white-space: nowrap;
  }
`;

export const ProductInfo = styled.div`
  position: relative;
  /* padding: 14px 10px 10px 14px; */
  height: 100%;
  border: 1px solid #efefef;

  /* display: block; */
`;

export const PriceInfo = styled.div`
  display: flex;
  -webkit-box-pack: justify;
  -webkit-box-align: center;
  align-items: center;
  height: 44px;
  padding: 0px 10px 0px 10px;
  border-top: 1px solid #efefef;
  justify-content: space-between;
`;

export const PriceBox = styled.div`
  display: flex;
  width: 100%;
  padding: 7px 10px 7px 10px;
  border-top: 1px solid #efefef;
  justify-content: space-between;

  & span {
    font-size: 16px;
    font-weight: 800;
    line-height: 1.5;
    white-space: nowrap;
  }
`;

export const PirceDC = styled.span`
  color: rgb(250, 98, 47);
  font-size: 16px;
  font-weight: 800;
  line-height: 1.5;
  white-space: nowrap;
  margin-right: 7px;
`;

export const RealPrice = styled.span`
  color: rgb(181, 181, 181);
  font-size: 14px;
  font-weight: 400;
  line-height: normal;
  text-decoration: line-through;
  margin-top: 2px;
`;
